module.exports.init = () => {
  for (const [, regions] of Object.entries(list)) {
    for (let [region, citys] of Object.entries(regions)) {
      if (region.includes('|')) {
        delete regions[region]
        let temp = region.split('|')
        for (let t of temp) {
          regions[t] = citys
        }
      }
    }
  }
  return list
}